          </svg>
          <h1 className="text-2xl font-bold">Safe Route</h1>
        </div>
        <div className="text-sm">
          <span className="bg-secondary-light text-primary-dark px-2 py-1 rounded-full font-semibold">
            India
          </span>
        </div>
      </div>
    </header>
  );
};

export default Header;
